const Notifications : React.FC<{ affilie: IAffilie }> = ({ affilie }) =>
{

    return (




            <>


            {affilie.cartes.map(carte=> 
            <Label.Group >
            <Icon name='address card' /> {format(carte.dateArrive, 'EEEE d MMMM yyyy', { locale: local }) }
            {carte.disponible ? <b>Disponible</b> : <b>Envoy√©e</b>}

            </Label.Group>




                )}

                </>


    )

}

export default Notifications
